(1795, 2, 1686649111, 'theme_moove', 'numbersfrontpagecontent', '<h2></h2>Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah; kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.<p></p>', '<h2>Trusted by 25,000+ happy customers.</h2>\r\n                    <p>With lots of unique blocks, you can easily build <br class=\"d-none d-sm-block d-md-none d-xl-block\">\r\n                        a page without coding. Build your next website <br class=\"d-none d-sm-block d-md-none d-xl-block\">\r\n                        within few minutes.</p>'),
(1796, 2, 1686649308, 'theme_moove', 'numbersfrontpagecontent', '<p>&lt;h2&gt;SD Muhammadiyah Bojonggede &lt;/h2&gt;</p><h2></h2>&lt;p&gt;Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah. &lt;br class=\"d-none d-sm-block d-md-none d-xl-block\"&gt;<p>Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.&nbsp;&lt;/p&gt;</p><p></p><p></p>', '<h2></h2>Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah; kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.<p></p>'),
(1797, 2, 1686649437, 'theme_moove', 'numbersfrontpagecontent', '<h4>SD Muhammadiyah Bojonggede</h4><h2></h2><p>Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah.</p><p>Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.&nbsp;</p><p></p><p></p>', '<p>&lt;h2&gt;SD Muhammadiyah Bojonggede &lt;/h2&gt;</p><h2></h2>&lt;p&gt;Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah. &lt;br class=\"d-none d-sm-block d-md-none d-xl-block\"&gt;<p>Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.&nbsp;&lt;/p&gt;</p><p></p><p></p>'),
(1798, 2, 1686649610, 'theme_moove', 'numbersfrontpagecontent', '', '<h4>SD Muhammadiyah Bojonggede</h4><h2></h2><p>Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah.</p><p>Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.&nbsp;</p><p></p><p></p>'),
