(1815, 2, 1686651272, 'theme_moove', 'numbersfrontpagecontent', '<p dir=\"ltr\" style=\"text-align: left;\"></p><h3>SD Muhammadiyah Bojonggede.</h3><p>Mewujudkan peserta didik yang berakhlaq mulia, berprestasi, dan berwawasan global yang dilandasi nilai-nilai budaya luhur sesuai dengan ajaran Agama Islam.<br></p><p></p>', '<p dir=\"ltr\" style=\"text-align: left;\"></p><h3>SD Muhammadiyah Bojonggede.</h3><p>Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah.</p><p><span style=\"font-size: 0.9375rem;\"><br></span></p><p><span style=\"font-size: 0.9375rem;\">Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.</span><br></p><p><span style=\"font-size: 0.9375rem;\"><br></span></p><p><span style=\"font-size: 0.9375rem;\">Kami telah mengembangkan program yang luas untuk membuka potensi setiap anak didik kami yang mereka sukai dan minati.<br></span></p><p><span style=\"font-size: 0.9375rem;\"><br></span></p><p><span style=\"font-size: 0.9375rem;\">Kami percaya dan telah mengarahkan, mengajarkan bahwa dampak kami bertahan seumur hidup.&nbsp;<br></span></p><p></p>'),
