(1963, 'theme_moove', 'marketingheading', 'E-Learning SD Muhammadiyah Bojonggede'),
(1964, 'theme_moove', 'marketingcontent', '<p dir=\"ltr\">Islami,&nbsp;<span style=\"font-size: 0.9375rem;\">Creative, Innovative,&nbsp;</span><span style=\"font-size: 0.9375rem;\">and&nbsp;</span><span style=\"font-size: 0.9375rem;\">Competitive School</span></p>'),
(1965, 'theme_moove', 'marketing1icon', '/hijab.png'),
(1966, 'theme_moove', 'marketing1heading', 'PEMBELAJAR MANDIRI'),
(1967, 'theme_moove', 'marketing1content', '<p dir=\"ltr\" style=\"text-align: left;\">Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah.<br></p>'),
(1968, 'theme_moove', 'marketing2icon', '/idea (1).png'),
(1969, 'theme_moove', 'marketing2heading', 'TERAMPIL DAN PEMIKIR YANG EFEKTIF'),
(1970, 'theme_moove', 'marketing2content', '<p dir=\"ltr\" style=\"text-align: left;\">Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.<br></p>'),
(1971, 'theme_moove', 'marketing3icon', '/health.png'),
(1972, 'theme_moove', 'marketing3heading', 'BROAD MINDED DAN SEHAT SECARA FISIK'),
(1973, 'theme_moove', 'marketing3content', '<p dir=\"ltr\" style=\"text-align: left;\">Kami telah mengembangkan program yang luas untuk membuka potensi setiap anak didik kami yang mereka sukai dan minati.<br></p>'),
(1974, 'theme_moove', 'marketing4icon', '/give-love.png'),
(1975, 'theme_moove', 'marketing4heading', 'KAYA SECARA EMOSIONAL, SPIRITUAL, DAN MORAL'),
(1976, 'theme_moove', 'marketing4content', '<p dir=\"ltr\" style=\"text-align: left;\">Kami percaya dan telah mengarahkan, mengajarkan bahwa dampak kami bertahan seumur hidup.&nbsp;<br></p>'),
(1977, 'theme_moove', 'numbersfrontpagecontent', '<p dir=\"ltr\" style=\"text-align: left;\"></p><h3>SD Muhammadiyah Bojonggede.</h3><p>Mewujudkan peserta didik yang berakhlaq mulia, berprestasi, dan berwawasan global yang dilandasi nilai-nilai budaya luhur sesuai dengan ajaran Agama Islam.<br></p><p></p>'),
