(93, 'id_s_theme_moove_numbersfrontpagecontent', 1, 'c8b24185624f33cdafdba5307bc859b3a4ab6923', 2, '<p dir=\"ltr\" style=\"text-align: left;\"></p><h3>SD Muhammadiyah Bojonggede.</h3><p>Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah.</p><p><span style=\"font-size: 0.9375rem;\"><br></span></p><p><span style=\"font-size: 0.9375rem;\">Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.</span><br></p><p><span style=\"font-size: 0.9375rem;\"><br></span></p><p><span style=\"font-size: 0.9375rem;\">Kami telah mengembangkan program yang luas untuk membuka potensi setiap anak didik kami yang mereka sukai dan minati.<br></span></p><p><span style=\"font-size: 0.9375rem;\"><br></span></p><p><span style=\"font-size: 0.9375rem;\">Kami percaya dan telah mengarahkan, mengajarkan bahwa dampak kami bertahan seumur hidup.&nbsp;<br></span></p><p></p>', NULL, 'yui_3_17_2_1_1686650910147_1503', 1686651034),
(118, 'id_message', 131, '115cf1af20ca1aa0b04f0a44dde8dee914cb18ba', 2, '', 544952536, 'yui_3_17_2_1_1687808453460_46', 1687808457),
(121, 'id_s_theme_moove_marketingcontent', 1, 'd588a2fe5df1583c8718b85974553d6f85bde01c', 2, '<p dir=\"ltr\">Islami,&nbsp;<span style=\"font-size: 0.9375rem;\">Creative, Innovative,&nbsp;</span><span style=\"font-size: 0.9375rem;\">and&nbsp;</span><span style=\"font-size: 0.9375rem;\">Competitive School</span></p>', -1, 'yui_3_17_2_1_1688568858975_82', 1688568933),
(122, 'id_s_theme_moove_marketing1content', 1, 'b62b4e18353eac663b99d6e4db46934376bd65ef', 2, '<p dir=\"ltr\" style=\"text-align: left;\">Kami adalah pembelajar seumur hidup yang dapat ibu/bapak percayai sebagai teman untuk memberdayakan anak-anak, agar berhasil di luar sekolah.<br></p>', -1, 'yui_3_17_2_1_1688568858975_375', 1688568933),
(123, 'id_s_theme_moove_marketing2content', 1, '4aa0ea3684d9b86dcc7d1bc310040af00b07e862', 2, '<p dir=\"ltr\" style=\"text-align: left;\">Kami percaya bahwa masa depan anak-anak kami menanti menjadi generasi muda hebat untuk memimpin dan menciptakan masyarakat yang harmonis dan islami.<br></p>', -1, 'yui_3_17_2_1_1688568858975_657', 1688568933),
(124, 'id_s_theme_moove_marketing3content', 1, '9dd63ac465a0996112a8c60ab788d462e6821a9f', 2, '<p dir=\"ltr\" style=\"text-align: left;\">Kami telah mengembangkan program yang luas untuk membuka potensi setiap anak didik kami yang mereka sukai dan minati.<br></p>', -1, 'yui_3_17_2_1_1688568858975_939', 1688568933),
(125, 'id_s_theme_moove_marketing4content', 1, '202c2f637218fa73c5473546b20347faaee15ed4', 2, '<p dir=\"ltr\" style=\"text-align: left;\">Kami percaya dan telah mengarahkan, mengajarkan bahwa dampak kami bertahan seumur hidup.&nbsp;<br></p>', -1, 'yui_3_17_2_1_1688568858975_1221', 1688568933),
(126, 'id_s_theme_moove_numbersfrontpagecontent', 1, 'f33ffb821224c5e3e29f5a262987befb561d0ab5', 2, '<p dir=\"ltr\" style=\"text-align: left;\"></p><h3>SD Muhammadiyah Bojonggede.</h3><p>Mewujudkan peserta didik yang berakhlaq mulia, berprestasi, dan berwawasan global yang dilandasi nilai-nilai budaya luhur sesuai dengan ajaran Agama Islam.<br></p><p></p>', -1, 'yui_3_17_2_1_1688568858975_1503', 1688568933),
